import React, { Component } from "react";

class Item extends Component {
  render() {
    const { titre, image, description, url } = this.props;
    return (
      <div>
        <container align="right">
          <row>
            <col xs={6} md={4}>
              <h4> {titre}</h4>
            </col>
            <h4> {description}</h4>
            <col xs={6} md={4}>
              <img width="100px" src={image} alt="image" />
            </col>
            <video src={url} alt="url" />
          </row>
        </container>
      </div>
    );
  }
}

export default Item;
